CREATE DEFINER=`root`@`localhost` PROCEDURE `cantidadProductoAlquiler`()
begin
	select count(p.codigo_producto) as cantidad
	from producto as p
	inner join producto_alquiler as pa
	on p.codigo_producto = pa.id_producto 
	inner join combo as c
	on c.codigo_combo = pa.combo 
	and c.nombre = 'sin combo';
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `CantidadProductoGaleria`(
										in subtipo varchar(20),
										in pagina varchar(15)
										)
begin
	if pagina = 'home' then
   		select count(codigo_producto) as cantidad
        from producto 
        inner join producto_venta on codigo_producto = id_producto 
        where Cantidad_Vendidos > 10 
        order by Cantidad_Vendidos desc;
   else
   		select count(codigo_producto) as cantidad
        from producto 
        inner join producto_venta on codigo_producto = id_producto 
        inner join subtipo_producto on subtipo_producto = id_subtipo_producto 
        and nombre = subtipo;
   end if;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `cantidadProductoPorSubtipo`(in id int)
begin

declare subtipo int;
set subtipo = (select subtipo_producto from producto where codigo_producto = id);

select count(*) as cantidad from producto as p
				inner join producto_venta as pv
                on p.codigo_producto = pv.id_producto
                where p.subtipo_producto = subtipo;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `filtrarPorMarca`(in marca varchar(15),
								 in tipo varchar(20))
begin
select codigo_producto, nombre_producto, precio_unidad, imagen
from producto as p
inner join producto_venta as pv
on p.codigo_producto = pv.id_producto 
inner join subtipo_producto  as sp
on p.subtipo_producto = sp.id_subtipo_producto 
and nombre = tipo
inner join marca as m
on p.marca = m.id_marca and m.nombre = marca;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `filtrarPorPrecio`(in precio varchar(20),
								 in tipo varchar(20))
begin
case  precio 
when '500' then select p.codigo_producto, p.nombre_producto, p.precio_unidad, p.imagen
				from producto as p
				inner join producto_venta as pv
				on p.codigo_producto = pv.id_producto and  p.precio_unidad > 0 and p.precio_unidad <= 500
				inner join subtipo_producto  as sp
				on p.subtipo_producto = sp.id_subtipo_producto 
				and nombre = tipo;
when '1000' then select p.codigo_producto, p.nombre_producto, p.precio_unidad, p.imagen
				from producto as p
				inner join producto_venta as pv
				on p.codigo_producto = pv.id_producto and  p.precio_unidad > 500 and p.precio_unidad <= 1000
				inner join subtipo_producto  as sp
				on p.subtipo_producto = sp.id_subtipo_producto 
				and nombre = tipo;
when '3000' then select p.codigo_producto, p.nombre_producto, p.precio_unidad, p.imagen
				from producto as p
				inner join producto_venta as pv
				on p.codigo_producto = pv.id_producto and  p.precio_unidad > 1000 and p.precio_unidad <= 3000
				inner join subtipo_producto  as sp
				on p.subtipo_producto = sp.id_subtipo_producto 
				and nombre = tipo;
when '4000' then select p.codigo_producto, p.nombre_producto, p.precio_unidad, p.imagen
				from producto as p
				inner join producto_venta as pv
				on p.codigo_producto = pv.id_producto and  p.precio_unidad > 3000 and p.precio_unidad <= 4000
				inner join subtipo_producto  as sp
				on p.subtipo_producto = sp.id_subtipo_producto 
				and nombre = tipo;
when '6000' then select p.codigo_producto, p.nombre_producto, p.precio_unidad, p.imagen
				from producto as p
				inner join producto_venta as pv
				on p.codigo_producto = pv.id_producto and  p.precio_unidad > 4000 and p.precio_unidad <= 6000
				inner join subtipo_producto  as sp
				on p.subtipo_producto = sp.id_subtipo_producto 
				and nombre = tipo;
when '8000' then select p.codigo_producto, p.nombre_producto, p.precio_unidad, p.imagen
				from producto as p
				inner join producto_venta as pv
				on p.codigo_producto = pv.id_producto and  p.precio_unidad > 6000 and p.precio_unidad <= 8000
				inner join subtipo_producto  as sp
				on p.subtipo_producto = sp.id_subtipo_producto 
				and nombre = tipo;
when '8001' then select p.codigo_producto, p.nombre_producto, p.precio_unidad, p.imagen
				from producto as p
				inner join producto_venta as pv
				on p.codigo_producto = pv.id_producto and  p.precio_unidad > 8000
				inner join subtipo_producto  as sp
				on p.subtipo_producto = sp.id_subtipo_producto 
				and nombre = tipo;
end case;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `listaProductosCombo`()
begin
	select c.nombre, c.codigo_combo, p.codigo_producto,p.nombre_producto,p.precio_unidad,p.descripcion,p.imagen
    from producto as p 
    inner join producto_alquiler as pa
    on p.codigo_producto = pa.id_producto
    inner join combo as c
    on c.codigo_combo = pa.combo and c.nombre <> 'sin combo';
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `listarGaleriaProductos`(in limite int,
										in lotes int,
										in subtipo varchar(20),
										in pagina varchar(15),
                                        in orden varchar(15)
										)
begin
	if pagina = 'home' then
   		select codigo_producto, nombre_producto, precio_unidad, imagen
   		from producto 
   		inner join producto_venta 
   		on codigo_producto = id_producto 
   		where Cantidad_Vendidos > 10 
   		order by Cantidad_Vendidos desc 
   		limit limite, lotes;
   else
   		case orden
			when 'mayor' then select codigo_producto, nombre_producto, precio_unidad, imagen
								from producto 
								inner join producto_venta 
								on codigo_producto = id_producto 
								inner join subtipo_producto 
								on subtipo_producto = id_subtipo_producto 
								and nombre = subtipo
                                order by precio_unidad desc
								limit limite, lotes;
            when 'menor' then select codigo_producto, nombre_producto, precio_unidad, imagen
								from producto 
								inner join producto_venta 
								on codigo_producto = id_producto 
								inner join subtipo_producto 
								on subtipo_producto = id_subtipo_producto 
								and nombre = subtipo
                                order by precio_unidad asc
								limit limite, lotes;
            when 'az' then select codigo_producto, nombre_producto, precio_unidad, imagen
								from producto 
								inner join producto_venta 
								on codigo_producto = id_producto 
								inner join subtipo_producto 
								on subtipo_producto = id_subtipo_producto 
								and nombre = subtipo
                                order by nombre_producto asc
								limit limite, lotes;
            when 'za' then select codigo_producto, nombre_producto, precio_unidad, imagen
								from producto 
								inner join producto_venta 
								on codigo_producto = id_producto 
								inner join subtipo_producto 
								on subtipo_producto = id_subtipo_producto 
								and nombre = subtipo
                                order by nombre_producto desc
								limit limite, lotes;
           when 'masVendidos' then select codigo_producto, nombre_producto, precio_unidad, imagen
								from producto 
								inner join producto_venta 
								on codigo_producto = id_producto 
								inner join subtipo_producto 
								on subtipo_producto = id_subtipo_producto 
								and nombre = subtipo
                                order by Cantidad_Vendidos desc 
								limit limite, lotes;                      
         end case;   
   end if;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `listarMarcaFiltrar`(
									in subtipo varchar(20)
                                    )
begin
	select distinct m.nombre
	from producto as p
	inner join producto_venta as pv 
	on p.codigo_producto = pv.id_producto
    inner join subtipo_producto as stp
    on stp.id_subtipo_producto = p.subtipo_producto and stp.nombre = subtipo
    inner join marca as m
    on m.id_marca = p.marca;
  
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `listarProductoAlquiler`(in limite int, in lotes int)
begin
	select p.codigo_producto, p.nombre_producto, p.precio_unidad, p.imagen
	from producto as p
	inner join producto_alquiler as pa
	on p.codigo_producto = pa.id_producto 
	inner join combo as c
	on c.codigo_combo = pa.combo 
	and c.nombre = 'sin combo'
	limit limite, lotes;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `listarProductoBuscadoVenta`(
										in valor varchar(60),
                                        in pagina varchar(15),
                                        in tipo varchar(15)
										)
begin
	if pagina = 'home' then
		set @consulta = concat('select codigo_producto, nombre_producto, precio_unidad, imagen
								from producto 
								inner join producto_venta 
								on codigo_producto = id_producto where nombre_producto like "%',valor,'%"');
   else
   		set @consulta = concat('select codigo_producto, nombre_producto, precio_unidad, imagen
								from producto 
								inner join producto_venta 
								on codigo_producto = id_producto 
								inner join subtipo_producto 
								on subtipo_producto = id_subtipo_producto 
								and nombre = "',tipo,'"
                                where nombre_producto like "%',valor,'%"');
   end if;
   
   prepare ejecutar from @consulta;
   execute ejecutar;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `listarTiposProductos`()
begin

select tp.nombre as Tipo,sp.nombre as subtipo from subtipo_producto as sp inner join tipo_producto as tp on sp.tipo_producto = tp.id_tipo_producto ;
				
end$$

