end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `productosPorCombo`(in id_combo int)
begin
	select p.codigo_producto, p.nombre_producto, p.precio_unidad, p.descripcion, p.imagen
	from producto as p
	inner join producto_alquiler as pa
	on p.codigo_producto = pa.id_producto 
	inner join combo as c
	on c.codigo_combo = pa.combo 
	and c.codigo_combo = id_combo;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `productosPorSubtipo`(in id int)
begin

declare subtipo int;
set subtipo = (select subtipo_producto from producto where codigo_producto = id);

select codigo_producto, nombre_producto, precio_unidad, imagen from producto as p
				inner join producto_venta as pv
                on p.codigo_producto = pv.id_producto
                where p.subtipo_producto = subtipo;
end$$

